import React from "react";

function Navbar() {
  return (
    <nav className="fixed top-0 left-0 w-full bg-transparent text-white py-4 px-6 flex justify-center items-center z-50">
      <ul className="flex space-x-6 text-sm tracking-wider">
        <li>
          <a href="#home" className="hover:text-blue-400">
            // Home
          </a>
        </li>
        <li>
          <a href="#expertise" className="hover:text-blue-400">
            // Expertise
          </a>
        </li>
        <li>
          <a href="#work" className="hover:text-blue-400">
            // Work
          </a>
        </li>
        <li>
          <a href="#experience" className="hover:text-blue-400">
            // Experience
          </a>
        </li>
        <li>
          <a href="#contact" className="hover:text-blue-400">
            // Contact
          </a>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
